import AddIcon from '@mui/icons-material/Add';
import RemoveIcon from '@mui/icons-material/Remove';
import React from 'react'
import styled from 'styled-components'
import Navbar from './Navbar'
import Hero from './Hero'
import Newsletter from './Newsletter'
import Footer from './Footer'


const Container = styled.div`

`

const Wrapper = styled.div`
    padding: 3rem;
    display: flex;
`

const ImgContainer = styled.div`
    flex: 1;
`

const Image = styled.img`
    width: 70%;
    margin-left: 6rem;
`

const InfoContainer = styled.div`
    flex: 1;
    padding: 0rem 3rem;
`

const Title = styled.h1`
    font-weight: 200;
`

const Desc = styled.p`
    margin: 1rem 0rem;
`

const Price = styled.span`
    font-weight: 100;
    font-size: 2.4rem;
`
const FilterContainer = styled.div`
    margin: 3rem 0rem;
    display: flex;
    justify-content: space-between;
`

const Filter = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin: 0rem 7rem;
`

const FilterTitle = styled.span`
    font-size: 1.2rem;
    font-weight: 200;
`

const FilterItemContainer = styled.select`
    margin-left: 0.5rem;
    padding: 0.3rem;
    font-family: "Montserrat", sans-serif;  
`

const FilterItem = styled.option`
    text-align: center;
`

const AddContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-evenly;
`;

const AmountContainer = styled.div`
  display: flex;
  align-items: center;
  font-weight: 700;
`;

const Amount = styled.span`
  width: 30px;
  height: 30px;
  border-radius: 10px;
  border: 1px solid teal;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Button = styled.button`
  padding: 15px;
  border: 2px solid teal;
  background-color: white;
  cursor: pointer;
  font-weight: 500;
  font-family: "Montserrat", sans-serif;  


  &:hover{
      background-color: #f8f4f4;
  }
`;



const IndividualProduct = () => {
  return (
    <Container>
    <Navbar/>
    <Hero/>
        <Wrapper>
            <ImgContainer>
                <Image src='/images/Baron.png'/>
            </ImgContainer>
            <InfoContainer>
                <Title>Baronne De Fleur</Title>
                <Desc>One of the best synchro monsters in the Yugioh TCG. It's good both going first and second because of its ability to destroy cards as well as provide omni-negation. It is also generic so you can play it any synchro deck that can reliably make level 10 monsters which will elevate the deck's ceiling and your overall win rate</Desc>
                <Price>$ 5</Price>            
                <FilterContainer>
                    <Filter>
                        <FilterTitle>Rarity</FilterTitle>
                        <FilterItemContainer>
                            <FilterItem>Near Mint</FilterItem>
                            <FilterItem>Lightly Played</FilterItem>
                            <FilterItem>Moderately Played</FilterItem>
                            <FilterItem>Damaged</FilterItem>
                        </FilterItemContainer>
                    </Filter>        
                    <Filter>
                        <FilterTitle>Condition</FilterTitle>
                        <FilterItemContainer>
                            <FilterItem>Near Mint</FilterItem>
                            <FilterItem>Lightly Played</FilterItem>
                            <FilterItem>Moderately Played</FilterItem>
                            <FilterItem>Damaged</FilterItem>
                        </FilterItemContainer>
                    </Filter>
                </FilterContainer>
                <AddContainer>
                    <AmountContainer>
                    <RemoveIcon />
                    <Amount>1</Amount>
                    <AddIcon />
                    </AmountContainer>
                    <Button>ADD TO CART</Button>
                </AddContainer>
            </InfoContainer>
        </Wrapper>
    <Newsletter/>
    <Footer/>
    </Container>
  )
}

export default IndividualProduct
